        <header className="sticky top-0 z-40 w-full border-b border-border bg-background/70 backdrop-blur supports-[backdrop-filter]:bg-background/60">
            <nav className="container flex items-center justify-between py-4">
                <div className="flex items-center gap-6">
                    <Logo />
                    <a href="/" className="text-sm text-muted-foreground transition-colors hover:text-foreground">Home</a>
                    <a href="#features" className="text-sm text-muted-foreground transition-colors hover:text-foreground">Features</a>
                    <a href="/store" className="text-sm text-muted-foreground transition-colors hover:text-foreground">Store</a>
                    <a href="/personal" className="text-sm text-muted-foreground transition-colors hover:text-foreground">Personal</a>
                </div>
                <div className="flex items-center gap-3">
                    <a href="/login" className="hidden md:inline-block">
                        <DaisyButton variant="ghost" size="sm">Login</DaisyButton>
                    </a>
                    <ThemeToggle />
                </div>
            </nav>
        </header>
    )
}
